import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 51.1-1205 Equivalent distribution.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/51.1-1205.md","filePath":"vacode/51.1-1205.md"}'),r={name:"vacode/51.1-1205.md"},n=a('<h1 id="§-51-1-1205-equivalent-distribution" tabindex="-1">§ 51.1-1205 Equivalent distribution. <a class="header-anchor" href="#§-51-1-1205-equivalent-distribution" aria-label="Permalink to &quot;§ 51.1-1205 Equivalent distribution.&quot;">​</a></h1><p>Any member who has attained the age of sixty and who has ten years of creditable service as an eligible volunteer shall be entitled to a distribution from the Fund equivalent to the contributions that he has made, the appropriate matching contributions made on his behalf, and any investment gains on such contributions less any losses, provided that such amount shall be reduced by the amount of any distribution to such member under § <a href="http://law.lis.virginia.gov/vacode/51.1-1206/" target="_blank" rel="noreferrer">51.1-1206</a>. The Board may provide alternative methods of distribution in lieu of a lump sum distribution to members entitled to a service award under this section.</p><p>The distributions provided shall be in addition to all pensions or other benefits under any other statutes of the Commonwealth or the United States.</p><p>1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0664" target="_blank" rel="noreferrer">664</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0672" target="_blank" rel="noreferrer">672</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0349" target="_blank" rel="noreferrer">349</a>.</p>',4),o=[n];function s(l,d,h,c,u,b){return t(),i("div",null,o)}const f=e(r,[["render",s]]);export{_ as __pageData,f as default};
